		/* Extend the array by 50%, plus the number we really need. */
		int new_size = (yy_n_chars) + number_to_move + ((yy_n_chars) >> 1);
		YY_CURRENT_BUFFER_LVALUE->yy_ch_buf = (char *) htwolcpre3realloc((void *) YY_CURRENT_BUFFER_LVALUE->yy_ch_buf,new_size  );
